popup.js
```javascript
document.addEventListener("DOMContentLoaded", function () {
  const takeScreenshotButton = document.getElementById("take-screenshot");
  takeScreenshotButton.addEventListener("click", function () {
    chrome.tabs.query({ active: true, currentWindow: true }, function (tabs) {
      chrome.tabs.sendMessage(tabs[0].id, { action: "take-screenshot" });
    });
  });
});
```
contentScript.js
```javascript
function takeScreenshot() {
  chrome.runtime.sendMessage({ action: "take-screenshot" });
}

chrome.runtime.onMessage.addListener(function (request, sender, sendResponse) {
  if (request.action === "take-screenshot") {
    chrome.tabs.captureVisibleTab(null, { format: "png" }, function (dataUrl) {
      const link = document.createElement("a");
      link.href = dataUrl;
      link.download = "screenshot.png";
      link.click();
    });
  }
});
```
This extension has the following functionality:

*   When the user clicks the extension's popup button, it sends a message to the content script to take a screenshot.
*   The content script receives the message and sends a request to the background script to take a screenshot.
*   The background script uses the `chrome.tabs.captureVisibleTab` method to capture the visible tab as a PNG image.
*   The image is then downloaded as a file named "screenshot.png".

Note that this is a basic example and you may want to add additional features such as:

